import Typewriter from "typewriter-effect/dist/core";

export const info = {
  headerLinks: [
    { title: "Home", path: "/" },
    { title: "Projects", path: "/projects" },
    { title: "About", path: "/about" },
  ],
  home: {
    title: "Hi, I'm Dhriti",
    subTitle:
      "I'm a Biomedical Engineering student at the University of Waterloo",
    typewriter: (
      <TypeWriterEffect
        textStyle={{
          fontFamily: "Red Hat Display",
          color: "#3F3D56",
          fontWeight: 500,
          fontSize: "1.5em",
        }}
        startDelay={2000}
        cursorColor="#3F3D56"
        multiText={["a builder", "a creater", "a developer", "an avid learner"]}
        multiTextDelay={1000}
        typeSpeed={30}
      />
    ),
    text: "press cmd k/ ctrl k to learn more about me",
  },
  projects: {
    title: "Some of the projects that I have worked on",
  },
  about: {
    title: "More about me..",
    text: "content",
  },
};
